import React from 'react';
import Day from './Day';
import { Container, Row, Button } from 'react-bootstrap';
const Calendar = () => {
    const week = [1, 2, 3, 4, 5, 6, 7];
    return (
    <Container>
     <Row>
    <Button>Previous</Button>
    <Button>Next</Button>
    </Row>
     <Row>
        {week.map(day => <Day key={day} date={day}  />)}
      </Row>
    </Container>
    
  );
};

export default Calendar;
